import React,{Component} from 'react';
import PostData from '../Coponent/PostData';
import Navibar from '../Coponent/Navibar';

class Signin extends Component {
    constructor(props){
        super(props)
        this.state = {
            email:"",
            password:""
        }
    }
    handleSubmit2= (event) =>{

        console.log(this.state)
    }    

    render(){
        const {email} =this.state
        const {password} =this.state
        return (
            <div className="back">
                <Navibar />
                <form >
                    <div className="login">
                        <h1>Log in</h1>
                        <div className="textbox">
                            <i className="fa fa-envelope" aria-hidden="true"></i>
                            <input type="text" name="email" placeholder="email" value={email}
                            onChange={(data) =>{this.setState({email:data.target.value})}}/>
                        </div>
                        <div className="textbox">
                            <i className="fa fa-lock" aria-hidden="true"></i>
                            <input type="password" name="password" placeholder="password" value={password}
                            onChange={(data) =>{this.setState({password:data.target.value})}}/>
                        </div>
                        <button className="btn" onClick={()=> {this.handleSubmit2()}}>
                            Log in
                        </button>
                    </div>
            </form>

            </div>
        );
    }
}

export default Signin;
